The Mademoiselle's Stallions (Kendo / Marc Dorcel/ DvdRip / 2013)

Maude is a beautiful young woman aged 21 with a very free attitude, collecting lovers and always open to new sexual experiences, especially if they involve several participants. Like she does every summer, Maude goes off to spend two weeks in England with her friend Charlotte, who lives with her parents surrounded by horses on a magnificent stud farm. Mary, Charlotte's mother, is a flamboyant woman in her forties who spends her time deceiving her husband with every young man she comes across, and humiliating her daughter who, unlike herself, is extremely shy with boys and therefore has an almost non-existent sex life.

Anissa Kate, Franki, Jasmine Jae, Paige Turnah, Pascal White, Peter Oh Tool, Ryan Ryder

